	this.SetR =  function( input ){ this.JSON.R = input };

	this.SetG =  function( input ){ this.JSON.G = input };

	this.SetB =  function( input ){ this.JSON.B = input };

	this.GetColor = function(){ return "rgb( "+ this.JSON.R +", "+ this.JSON.G +", "+ this.JSON.B +")" };

	this.rgbToHex = function(R,G,B) {return this.toHex(R)+this.toHex(G)+this.toHex(B)};

	this.toHex = function(n)
	{
		n = parseInt(n,10);
		if (isNaN(n)) return "00";
		n = Math.max(0,Math.min(n,255));
		return "0123456789ABCDEF".charAt((n-n%16)/16)  + "0123456789ABCDEF".charAt(n%16);
	}

